import './ListForm.css';

const ListForm=()=>{
    return(
        <div className="listform">
            <form>
                <div className="listform-label"><label >Enter List Item</label>
                </div>
                <input type="text"></input>
            </form>
        </div>
    );
}

export default ListForm;
